            fields.map((field) => {
             console.log('location',typeof field)
              return (
                <button onClick={setlocation(field)}>{field} </button>
              )
            })
          }
          {type === 'Rest_type' &&
            fields.map((field) => {

              return (
                <button onClick={setRest_type(field)}>{field} </button>
              )
            })
          }
        </div>
      </div>
      );
